import React from "react";
import {Link} from 'react-router-dom';
const Menu = ()=>{
    return (
        <>
            {/* page reloads */}
            <a href="/">AboutUs</a>
            <a href="/contact">ContactUs</a>
            <br/>
            {/* page dont reload but active tab unknown */}
            <Link to='/'>AboutUs</Link>
            <Link to='/contact'>ContactUs</Link>
        </>
    );
}
export default Menu;
